import React, {useState} from "react"
import './loginForm.css'

export const  LoginForm = (props) => {

const[token, setToken]  = useState('');

const handleSubmit = (e) => {
e.preventDefault();
	console.log(token);

}
    return (
		
		 <div className="auth-form-container">
		 <span onClick={() => props.onFormSwitch('')}>&times;</span>
		 <>
		 <h2 className="head-text">Check your email/sms for verification</h2>
         <form className="login-form" onSubmit={handleSubmit}>
           <label htmlFor="token">Token</label>
		   <input value={token} onChange={(e) => setToken(e.target.value)}  type="text" placeholder="Enter token to view" id="token" name="token"></input>
		   <button className="verify-btn" type="submit">Verify</button>
		 </form>
		<button className="click-btn" onClick={() =>  props.onFormSwitch("registerForm")}>Don't have a token? Click here</button>
		 </>
		</div>
		
    
    )
}
export default LoginForm;
